	DEB("RenConst:dMSfsq1(2,1,4,1)", dMSfsq1(2,1,4,1))
#endif

	dZbarSf1(1,1,4,1) = dZSf1(1,1,4,1)

#if DEBUG >= 4
	DEB("RenConst:dZbarSf1(1,1,4,1)", dZbarSf1(1,1,4,1))
#endif

	dup12 = -MSf2(1,4,1) + MSf2(2,4,1)

        dup13 = Mino3*USf(2,2,4,1)*USfC(1,1,4,1) + 
     &    Mino3C*USf(2,1,4,1)*USfC(1,2,4,1)

        dup14 = USf(2,1,4,1)*USfC(1,1,4,1) + 
     &    USf(2,2,4,1)*USfC(1,2,4,1)

	dup15 = A0(MGl2) + B0i(bb1,MSf2(2,4,1),MD2,MGl2)*MSf2(2,4,1)

        dZbarSf1(1,2,4,1) = 
     &   -((-2*dMSfsq1(2,1,4,1) + 
     &        2/Pi*(Alfas*((4*MD)/3.D0*
     &              (dup13*B0i(bb0,MSf2(2,4,1),MD2,MGl2)) - 
     &             4/3.D0*(dup14*
     &                (dup15 + MD2*B0i(bb0,MSf2(2,4,1),MD2,MGl2))))
     &           ))/dup12)

	LOOP(Sfe3, 1,2,1)

        dZbarSf1(1,2,4,1) = 
     &   dZbarSf1(1,2,4,1) - 
     &    2/(3.D0*Pi)*(Alfas*A0(MSf2(Sfe3,4,1))*
     &        (USf(Sfe3,1,4,1)*USfC(1,1,4,1) - 
     &          USf(Sfe3,2,4,1)*USfC(1,2,4,1))*
     &        (USf(2,1,4,1)*USfC(Sfe3,1,4,1) - 
     &          USf(2,2,4,1)*USfC(Sfe3,2,4,1)))/dup12

	ENDLOOP(Sfe3)

#if DEBUG >= 4
	DEB("RenConst:dZbarSf1(1,2,4,1)", dZbarSf1(1,2,4,1))
#endif

	dup16 = MSf2(1,4,1) - MSf2(2,4,1)

        dup17 = Mino3*USf(1,2,4,1)*USfC(2,1,4,1) + 
     &    Mino3C*USf(1,1,4,1)*USfC(2,2,4,1)

        dup18 = USf(1,1,4,1)*USfC(2,1,4,1) + 
     &    USf(1,2,4,1)*USfC(2,2,4,1)

	dup19 = A0(MGl2) + B0i(bb1,MSf2(1,4,1),MD2,MGl2)*MSf2(1,4,1)

        dZbarSf1(2,1,4,1) = 
     &   -((-2*dMSfsq1(1,2,4,1) + 
     &        2/Pi*(Alfas*((4*MD)/3.D0*
     &              (dup17*B0i(bb0,MSf2(1,4,1),MD2,MGl2)) - 
     &             4/3.D0*(dup18*
     &                (dup19 + MD2*B0i(bb0,MSf2(1,4,1),MD2,MGl2))))
     &           ))/dup16)

	LOOP(Sfe3, 1,2,1)

        dZbarSf1(2,1,4,1) = 
     &   dZbarSf1(2,1,4,1) - 
     &    2/(3.D0*Pi)*(Alfas*A0(MSf2(Sfe3,4,1))*
     &        (USf(Sfe3,1,4,1)*USfC(2,1,4,1) - 
     &          USf(Sfe3,2,4,1)*USfC(2,2,4,1))*
     &        (USf(1,1,4,1)*USfC(Sfe3,1,4,1) - 
     &          USf(1,2,4,1)*USfC(Sfe3,2,4,1)))/dup16

	ENDLOOP(Sfe3)

#if DEBUG >= 4
	DEB("RenConst:dZbarSf1(2,1,4,1)", dZbarSf1(2,1,4,1))
#endif

	dZbarSf1(2,2,4,1) = dZSf1(2,2,4,1)

#if DEBUG >= 4
	DEB("RenConst:dZbarSf1(2,2,4,1)", dZbarSf1(2,2,4,1))
#endif

        dZSf1(1,2,4,1) = 
     &   (-2*(dMSfsq1(1,2,4,1) + 
     &        1/Pi*(Alfas*(B0i(bb0,MSf2(2,4,1),MD2,MGl2)*
     &              (-((4*MD)/3.D0*dup17) + (4*MD2)/3.D0*dup18) + 
     &             4/3.D0*(dup15*dup18)))))/dup16

	LOOP(Sfe3, 1,2,1)

        dZSf1(1,2,4,1) = 
     &   dZSf1(1,2,4,1) + 2/(3.D0*Pi)*
     &     (Alfas*A0(MSf2(Sfe3,4,1))*
     &        (USf(Sfe3,1,4,1)*USfC(2,1,4,1) - 
     &          USf(Sfe3,2,4,1)*USfC(2,2,4,1))*
     &        (USf(1,1,4,1)*USfC(Sfe3,1,4,1) - 
     &          USf(1,2,4,1)*USfC(Sfe3,2,4,1)))/dup16

	ENDLOOP(Sfe3)

#if DEBUG >= 4
	DEB("RenConst:dZSf1(1,2,4,1)", dZSf1(1,2,4,1))
#endif

        dZSf1(2,1,4,1) = 
     &   (-2*dMSfsq1(2,1,4,1) + 
     &      2/Pi*(Alfas*((4*MD)/3.D0*
     &            (dup13*B0i(bb0,MSf2(1,4,1),MD2,MGl2)) - 
     &           4/3.D0*(dup14*
     &              (dup19 + MD2*B0i(bb0,MSf2(1,4,1),MD2,MGl2))))))
     &     /dup12

	LOOP(Sfe3, 1,2,1)

        dZSf1(2,1,4,1) = 
     &   dZSf1(2,1,4,1) + 2/(3.D0*Pi)*
     &     (Alfas*A0(MSf2(Sfe3,4,1))*
     &        (USf(Sfe3,1,4,1)*USfC(1,1,4,1) - 
     &          USf(Sfe3,2,4,1)*USfC(1,2,4,1))*
     &        (USf(2,1,4,1)*USfC(Sfe3,1,4,1) - 
     &          USf(2,2,4,1)*USfC(Sfe3,2,4,1)))/dup12

	ENDLOOP(Sfe3)

#if DEBUG >= 4
	DEB("RenConst:dZSf1(2,1,4,1)", dZSf1(2,1,4,1))
#endif

